import React from 'react';
import Spline from '@splinetool/react-spline';

export default function Home() {
  return (
    <div style={{
      position: 'relative',
      margin: 0,
      padding: 0,
      width: '100vw',
      height: '100vh',
      overflow: 'hidden'
    }}>
      <Spline
        scene="https://prod.spline.design/3z9PPkKZWxSG4JeS/scene.splinecode"
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          // Remove or change objectFit if you see repeated tiles
          objectFit: 'cover',
          zIndex: -1
        }}
      />
      <h1 style={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        color: '#fff',
        zIndex: 1
      }}>
        Welcome to UniFix!
      </h1>
    </div>
  );
}
